$wins = 0;
$lost = 0;
$draw = 0;
$finalScore = 0;

foreach ($games as $game) {
    $opponent = $game[0];
    $me = $game[1];

    // Game part 2
    $meShould = null;
    if ($me == 'Rock') $meShould = 'loose';
    if ($me == 'Paper') $meShould = 'draw';
    if ($me == 'Scissors') $meShould = 'win';


    if ($opponent == 'Rock') {
        if ($meShould == 'win') {
            $me = 'Paper';
        }
        if ($meShould == 'loose') {
            $me = 'Scissors';
        }
        if ($meShould == 'draw') {
            $me = 'Rock';
        }
    }

    if ($opponent == 'Paper') {
        if ($meShould == 'win') {
            $me = 'Scissors';
        }
        if ($meShould == 'loose') {
            $me = 'Rock';
        }
        if ($meShould == 'draw') {
            $me = 'Paper';
        }
    }

    if ($opponent == 'Scissors') {
        if ($meShould == 'win') {
            $me = 'Rock';
        }
        if ($meShould == 'loose') {
            $me = 'Paper';
        }
        if ($meShould == 'draw') {
            $me = 'Scissors';
        }
    }
    // end



    $shapeScore = 0;
    $gameScore = 0;

    if ($me == 'Rock') $shapeScore = 1;
    if ($me == 'Paper') $shapeScore = 2;
    if ($me == 'Scissors') $shapeScore = 3;


    if ($me == $opponent) {
        $draw++;
        $gameScore = 3;
    }

    if ($opponent == 'Rock' && $me == 'Paper') {
        $wins++;
        $gameScore = 6;
    }

    if ($opponent == 'Paper' && $me == 'Rock') {
        $lost++;
    }


    if ($opponent == 'Rock' && $me == 'Scissors') {
        $lost++;
    }

    if ($opponent == 'Scissors' && $me == 'Rock') {
        $wins++;
        $gameScore = 6;
    }


    if ($opponent == 'Scissors' && $me == 'Paper') {
        $lost++;
    }

    if ($opponent == 'Paper' && $me == 'Scissors') {
        $wins++;
        $gameScore = 6;
    }

    $roundScore = $gameScore + $shapeScore;

    $finalScore += $roundScore;

}


var_dump(
    'Draw: '. $draw
);

var_dump(
    'Wins: '. $wins
);


var_dump(
    'Lost: '. $lost
);

var_dump(
    'Final Score: '. $finalScore
);

var_dump(
    'Games: '. count($games)
);
var_dump(
    'Sum: '. ($lost + $wins + $draw)
);
